import React, {Component} from 'react';
import ListBook from './component/ListBook';
import ListUser from './component/ListUser';
import ListTrans from './component/ListTrans';
import { Switch, Route } from 'react-router-dom';

class Dashboard extends Component {
    render(){
        return(
            <React.Fragment>
                <Switch>
                <Route path="/dashboard/listbook" component={ListBook}></Route>
                <Route path="/dashboard/listuser" component={ListUser}></Route>
                <Route path="/dashboard/listtrans" component={ListTrans}></Route>
                </Switch>
            </React.Fragment>
        )
    }
}

export default Dashboard;
